import React from "react";

export default function MeditationForm() {
  return (
     <div class="meditation_form">
         <form>
         <input type="text" name="time" placeholder="Time in minutes" />
          <input type="date" name="date" placeholder="Date you practiced" />
         </form>
    </div>
  )
}
